import React from "react";
import NavBar from "./NavBar";

const Header = () => {
	return (
		<header className="hero">
			<h1 className="intro-text">
				Hej, I am Sofia Darke, a web developer from Stockholm currently studying
				at Hyper Island.
			</h1>
			<a href="">GitHub</a>
			<a href="">LinkedIn</a>
			<img className="smiley" src="/media/smiley.svg" alt="smiley-animation" />
			<NavBar />
		</header>
	);
};

export default Header;
